svg.script:
    const nrOfLines = 8;
	const letterDelay = 80;
	const fadeOutDelay = 2000;
	const lineDelay = 1000;
	var delay = 0;
    for (var i=0; i<nrOfLines; i++) {
    	var line = document.getElementById("line-"+(i+1));
		var children = line.children[0].children;
		var nrOfChildren = children.length;
		for (var j=0; j<nrOfChildren; j++) {
			var path = children[j]
			path.style.animationDelay = delay + 'ms';
			delay += letterDelay;
		}
		delay += fadeOutDelay;
		line.style.animationDelay = delay + 'ms';
		delay += lineDelay;
    }
	var logo = document.getElementById("logo");
	logo.style.animationDelay = delay + 'ms';
